<!DOCTYPE html>
<html><head><meta charset="utf-8"><title>Traffic Dashboard</title>
<link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css" integrity="sha256-p4NxAoJBhIIN+hmNHrzRCf9tD/miZyoHS5obTRR9BMY=" crossorigin=""/>
<script src="https://unpkg.com/pako@2.1.0/dist/pako.min.js"></script>
<style>
body{margin:0;padding:0;font-family:'Segoe UI',Tahoma,Geneva,Verdana,sans-serif}
#map{position:absolute;top:0;bottom:0;left:0;right:0}
#loading{position:fixed;top:50%;left:50%;transform:translate(-50%,-50%);background:white;padding:40px;border-radius:15px;box-shadow:0 4px 20px rgba(0,0,0,0.2);z-index:2000;text-align:center}
#weather-panel{position:fixed;top:20px;left:20px;background:white;padding:20px;border-radius:10px;box-shadow:0 4px 6px rgba(0,0,0,0.1);z-index:1000;width:280px;display:none}
#controls{position:fixed;top:20px;right:20px;background:white;padding:20px;border-radius:10px;box-shadow:0 4px 6px rgba(0,0,0,0.1);z-index:1000;width:280px}
.panel-title{margin:0 0 15px 0;color:#2c3e50;font-size:18px;padding-bottom:10px;border-bottom:2px solid #667eea}
.weather-info{background:linear-gradient(135deg,#667eea 0%,#764ba2 100%);padding:15px;border-radius:8px;color:white;margin-bottom:15px}
.weather-emoji{font-size:48px;text-align:center;margin:10px 0}
.weather-condition{font-size:16px;text-align:center;font-weight:bold;margin:5px 0}
.temp-container{display:flex;justify-content:space-around;margin:10px 0;padding:10px;background:rgba(255,255,255,0.2);border-radius:5px}
.temp-item{text-align:center}
.temp-label{font-size:11px;opacity:0.9}
.temp-value{font-size:20px;font-weight:bold}
.sun-info{background:#f8f9fa;padding:10px;border-radius:8px;font-size:13px;margin-top:10px}
.sun-status{padding:8px;background:white;border-radius:5px;text-align:center;font-weight:bold;margin-top:8px}
.sun-status.before-sunrise{background:#ffeaa7;color:#2d3436}
.sun-status.after-sunrise{background:#74b9ff;color:#2d3436}
.sun-status.after-sunset{background:#a29bfe;color:#2d3436}
.control-group{margin-bottom:20px}
label{display:block;font-weight:bold;margin-bottom:8px;color:#333;font-size:14px}
select,input[type="range"]{width:100%;padding:8px;border:2px solid #ddd;border-radius:5px;font-size:14px}
#time-display{text-align:center;font-size:28px;font-weight:bold;color:white;margin:10px 0;padding:12px;background:linear-gradient(135deg,#667eea 0%,#764ba2 100%);border-radius:8px}
#stats{margin-top:15px;padding:15px;background:#f8f9fa;border-radius:8px;font-size:13px}
.stat-row{display:flex;justify-content:space-between;margin:8px 0;padding:8px 0;border-bottom:1px solid #dee2e6}
.stat-row:last-child{border-bottom:none}
.stat-label{color:#666}.stat-value{font-weight:bold;color:#2c3e50;font-size:15px}
.play-button{width:100%;padding:14px;background:linear-gradient(135deg,#667eea 0%,#764ba2 100%);color:white;border:none;border-radius:8px;cursor:pointer;font-size:16px;font-weight:bold;margin-top:15px}
.play-button:hover{transform:translateY(-2px);box-shadow:0 4px 8px rgba(0,0,0,0.2)}
.play-button.playing{background:linear-gradient(135deg,#f093fb 0%,#f5576c 100%)}
#legend{position:fixed;bottom:30px;right:20px;background:white;padding:15px;border-radius:10px;box-shadow:0 4px 6px rgba(0,0,0,0.1);z-index:1000}
.legend-scale{display:flex;height:20px;width:200px;background:linear-gradient(to right,#ffffcc 0%,#ffeda0 12.5%,#fed976 25%,#feb24c 37.5%,#fd8d3c 50%,#fc4e2a 62.5%,#e31a1c 75%,#bd0026 87.5%,#800026 100%);border-radius:3px;margin:5px 0}
.legend-labels{display:flex;justify-content:space-between;font-size:11px;color:#666}
</style></head><body>

</div>
<style>@keyframes spin{0%{transform:rotate(0deg)}100%{transform:rotate(360deg)}}</style>

<div class="control-group"><label>ğŸ“… Select Date:</label>

</div></div>

const trafficData={};
const weatherData={};

for(const date in trafficDataCompact){
trafficData[date]={};
for(const hour in trafficDataCompact[date]){
trafficData[date][hour]=trafficDataCompact[date][hour].map(item=>({
lat:item[0],
lon:item[1],
traffic:item[2],
location_name:item[3],
color:getColor(item[2])
}));
}
}

for(const date in weatherDataCompact){
weatherData[date]={};
for(const hour in weatherDataCompact[date]){
const w=weatherDataCompact[date][hour];
weatherData[date][hour]={
conditions:w.c,
tempmax:w.x,
tempmin:w.n,
sunrise:w.r,
sunset:w.s
};
}
}

console.log('Data loaded!',Object.keys(trafficData).length,'dates');

let currentMarkers=[];
let isPlaying=false;
let playInterval=null;

L.tileLayer('https://{s}.basemaps.cartocdn.com/light_all/{z}/{x}/{y}{r}.png',{maxZoom:19}).addTo(map);

function getColor(traffic){
const ratio=(traffic-MIN_TRAFFIC)/(MAX_TRAFFIC-MIN_TRAFFIC);
if(ratio<0.125)return'#ffffcc';
if(ratio<0.25)return'#ffeda0';
if(ratio<0.375)return'#fed976';
if(ratio<0.5)return'#feb24c';
if(ratio<0.625)return'#fd8d3c';
if(ratio<0.75)return'#fc4e2a';
if(ratio<0.875)return'#e31a1c';
if(ratio<1)return'#bd0026';
return'#800026';
}

function getWeatherEmoji(conditions){
if(!conditions)return'â˜€ï¸';
const cond=conditions.toLowerCase();
if(cond.includes('snow'))return'â˜ƒï¸';
if(cond.includes('rain'))return'â˜”ï¸';
if(cond.includes('partially cloudy'))return'ğŸŒ¥ï¸';
if(cond.includes('overcast'))return'ğŸŒ«ï¸';
if(cond.includes('clear'))return'â˜€ï¸';
return'ğŸŒ¤ï¸';
}

function getSunStatus(hour,sunrise,sunset){
const hourStr=hour.toString().padStart(2,'0')+':00';
if(!sunrise||!sunset)return'Unknown';
if(hourStr<sunrise)return'before-sunrise';
if(hourStr<sunset)return'after-sunrise';
return'after-sunset';
}

function getSunStatusText(status){
if(status==='before-sunrise')return'ğŸŒ™ Before Sunrise';
if(status==='after-sunrise')return'â˜€ï¸ After Sunrise';
if(status==='after-sunset')return'ğŸŒ™ After Sunset';
return'Unknown';
}

function updateWeather(date,hour){
if(!HAS_WEATHER||!weatherData[date]||!weatherData[date][hour]){
document.getElementById('weather-panel').style.display='none';
return;
}
document.getElementById('weather-panel').style.display='block';
const weather=weatherData[date][hour];
document.getElementById('weather-emoji').textContent=getWeatherEmoji(weather.conditions);
document.getElementById('weather-condition').textContent=weather.conditions||'Clear';
document.getElementById('temp-max').textContent=weather.tempmax!==null&&!isNaN(weather.tempmax)?weather.tempmax.toFixed(1)+'Â°':'--Â°';
document.getElementById('temp-min').textContent=weather.tempmin!==null&&!isNaN(weather.tempmin)?weather.tempmin.toFixed(1)+'Â°':'--Â°';
document.getElementById('sunrise-time').textContent=weather.sunrise||'--:--';
document.getElementById('sunset-time').textContent=weather.sunset||'--:--';
const sunStatus=getSunStatus(hour,weather.sunrise,weather.sunset);
const sunStatusEl=document.getElementById('sun-status');
sunStatusEl.textContent=getSunStatusText(sunStatus);
sunStatusEl.className='sun-status '+sunStatus;
}

function updateMap(){
const selectedDate=document.getElementById('date-select').value;
const selectedHour=parseInt(document.getElementById('hour-slider').value);
document.getElementById('time-display').textContent=selectedHour.toString().padStart(2,'0')+':00';
updateWeather(selectedDate,selectedHour.toString());
currentMarkers.forEach(marker=>map.removeLayer(marker));
currentMarkers=[];
const data=trafficData[selectedDate]?trafficData[selectedDate][selectedHour]:[];
if(!data||data.length===0){updateStats(0,0,0,0);return;}
let totalTraffic=0;
let maxTraffic=0;
data.forEach(point=>{
totalTraffic+=point.traffic;
maxTraffic=Math.max(maxTraffic,point.traffic);
const radius=8+(point.traffic/MAX_TRAFFIC)*32;
const circle=L.circleMarker([point.lat,point.lon],{
radius:radius,
fillColor:point.color,
color:'#333',
weight:2,
opacity:0.8,
fillOpacity:0.7
});
circle.bindPopup(`<div style="font-family:Arial"><h4 style="margin:5px 0">ğŸš¦ Traffic Data</h4><hr style="margin:8px 0">
<p style="margin:5px 0"><strong>ğŸ“ Location:</strong> ${point.location_name}</p>
<p style="margin:5px 0"><strong>ğŸ“… Date:</strong> ${selectedDate}</p>
<p style="margin:5px 0"><strong>ğŸ• Time:</strong> ${selectedHour.toString().padStart(2,'0')}:00</p>
<p style="margin:8px 0;padding:10px;background:#f8f9fa;border-radius:5px">
<strong>ğŸš— Traffic Volume:</strong> <span style="color:#e74c3c;font-size:20px;font-weight:bold">${point.traffic.toLocaleString()}</span></p></div>`);
circle.bindTooltip(`Traffic: ${point.traffic.toLocaleString()}`,{permanent:false,direction:'top'});
circle.addTo(map);
currentMarkers.push(circle);
});
const avgTraffic=Math.round(totalTraffic/data.length);
updateStats(data.length,totalTraffic,avgTraffic,maxTraffic);
}

function updateStats(locations,total,avg,peak){
document.getElementById('location-count').textContent=locations;
document.getElementById('total-traffic').textContent=total.toLocaleString();
document.getElementById('avg-traffic').textContent=avg.toLocaleString();
document.getElementById('peak-traffic').textContent=peak.toLocaleString();
}

function togglePlay(){
const button=document.getElementById('play-button');
if(isPlaying){
clearInterval(playInterval);
isPlaying=false;
button.textContent='â–¶ Play Timeline';
button.classList.remove('playing');
}else{
isPlaying=true;
button.textContent='â¸ Pause';
button.classList.add('playing');
playInterval=setInterval(()=>{
const slider=document.getElementById('hour-slider');
let currentHour=parseInt(slider.value);
currentHour=(currentHour+1)%24;
slider.value=currentHour;
updateMap();
},500);
}
}

// Initialize
document.getElementById('loading').style.display='none';
const dates=Object.keys(trafficData).sort();
const dateSelect=document.getElementById('date-select');
dateSelect.innerHTML=dates.map(d=>`<option value="${d}">${d}</option>`).join('');
document.getElementById('date-select').addEventListener('change',updateMap);
document.getElementById('hour-slider').addEventListener('input',updateMap);
document.getElementById('play-button').addEventListener('click',togglePlay);
updateMap();
</script></body></html>
